import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first product card's "Add to Cart" button to appear
    // Try multiple selector strategies
    // 1. By class and order: .product-card .add-to-cart
    await page.waitForSelector('.product-card .add-to-cart', { timeout: 5000 });

    // Click the first "Add to Cart" button
    const addToCartButtons = await page.$$('.product-card .add-to-cart');
    if (!addToCartButtons || addToCartButtons.length === 0) {
      throw new Error('No Add to Cart button found');
    }
    await addToCartButtons[0].click();

    // Wait for notification to appear (success message)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_add_to_cart.png'));

    // Extract cart count from the cart counter element
    // Try multiple selector strategies: #cartCount, .cart-count, .cart
    let cartCount = null;
    try {
      // Try #cartCount
      const cartCountElem = await page.$('#cartCount');
      if (cartCountElem) {
        cartCount = await cartCountElem.textContent();
      } else {
        // Try .cart-count
        const cartCountElem2 = await page.$('.cart-count');
        if (cartCountElem2) {
          cartCount = await cartCountElem2.textContent();
        } else {
          // Try extracting number from .cart
          const cartElem = await page.$('.cart');
          if (cartElem) {
            const cartText = await cartElem.textContent();
            // Try to extract the number before "Cart"
            const match = cartText.match(/(\d+)/);
            if (match) {
              cartCount = match[1];
            }
          }
        }
      }
      if (cartCount) cartCount = cartCount.trim();
    } catch (e) {
      cartCount = null;
    }

    // Return result
    return {
      success: true,
      action: "Added the first product to cart and verified cart count increased",
      extractedData: {
        cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
